import { style } from "@mui/system";
import React from "react";
import styled from "styled-components";

const OverView = () => {
  const Overview = styled.div``;
  const OverViewContainer = styled.div`
    padding: 20px;
    display: flex;
    justify-content: space-between;
    :nth-child(1) {
      background-color: #abdafc;
    }
  `;
  const Card = styled.div`
    width: 200px;
    height: 200px;
    display: flex;
    flex-direction: column;
    justify-content: space-between;
    // background-color: green;
    margin-right: 20px;
  `;
  const CardTop = styled.div`
    // background-color: red;
    display: flex;
    flex-direction: column;
    justify-content: center;
    align-items: center;
    height: 200px;
  `;
  const CardNum = styled.span`
    font-size: 40px;
    margin-bottom: 20px;
  `;
  const CardSpan = styled.span``;
  const CardDesc = styled.span`
    display: flex;
    justify-content: center;
  `;
  return (
    <Overview>
      <OverViewContainer>
        <Card>
          <CardTop>
            <CardNum>10</CardNum>
            <CardSpan>10 New</CardSpan>
          </CardTop>
          <CardDesc>New Profiles</CardDesc>
        </Card>
        <Card>
          <CardTop>
            <CardNum>20</CardNum>
            <CardSpan>20 Liked</CardSpan>
          </CardTop>
          <CardDesc>Liked Your Profile</CardDesc>
        </Card>
        <Card>
          <CardTop>
            <CardNum>30</CardNum>
            <CardSpan>30 Shortlisted</CardSpan>
          </CardTop>
          <CardDesc>Shortlisted your Profile</CardDesc>
        </Card>
        <Card>
          <CardTop>
            <CardNum>40</CardNum>
            <CardSpan>40 New</CardSpan>
          </CardTop>
          <CardDesc>Viewed Your Profile</CardDesc>
        </Card>
      </OverViewContainer>
    </Overview>
  );
};

export default OverView;
